define(["vue","require","gitee","utils","markdownIt"],(function(Vue,require,gitee,utils,markdownIt){const md=markdownIt();return{data:()=>({cfg:{},mdContent:""}),watch:{},methods:{},mounted(){gitee.getFileContent("config/wyd2021.json",!1,!0).then(data=>{this.cfg=data.home}),gitee.getFileContent("md/home.md").then(content=>{this.mdContent=md.render(content)})},template:'\n        <div class="wyd-home d-flex flex-column">\n            <div class="ui vertical flex-grow-1 wyd-home-content">\n                <div class="ui text container mt-5">\n                    <div v-html="mdContent"></div>\n                </div>\n            </div>\n        </div>\n        '}}));